public class InnerApplicationRunConfigurationFactory(Action<Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration>
{

    internal InnerApplicationFlinkRunConfigurationFactory FlinkRunConfigurationFactory { get; set; }

    internal InnerApplicationApplicationRestoreConfigurationFactory ApplicationRestoreConfigurationFactory { get; set; }

    protected override Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration Create()
    {
        var runConfigurationResult = CreateRunConfiguration();
        factoryAction?.Invoke(runConfigurationResult);

        return runConfigurationResult;
    }

    private Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration CreateRunConfiguration()
    {
        var runConfigurationResult = new Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration();

        return runConfigurationResult;
    }
    public override void CreateChildren(Humidifier.KinesisAnalyticsV2.ApplicationTypes.RunConfiguration result)
    {
        base.CreateChildren(result);

        result.FlinkRunConfiguration ??= FlinkRunConfigurationFactory?.Build();
        result.ApplicationRestoreConfiguration ??= ApplicationRestoreConfigurationFactory?.Build();
    }

} // End Of Class

